查询的生命周期是这样的； 对CnosQL查询字符串进行标记，然后将其解析为抽象语法树(AST)。这是查询本身的代码表示。 AST被传递给QueryExecutor, QueryExecutor将查询定向到适当的处理程序。例如，与元数据相关的查询由元服务执行，SELECT语句由分片自己执行。 然后，查询引擎确定与SELECT语句的时间范围匹配的分片。从这些分片中，为语句中的每个字段创建迭代器。 迭代器被传递给发射器，发射器耗尽迭代器并连接结果点。发射器的工作是将简单的时间/值点转换为返回给客户端的更复杂的结果对象。 理解迭代器 迭代器是查询引擎的核心。它们为在一组点上循环提供了一个简单的接口。例如，这是一个浮点数的迭代器: type FloatIterator interface { Next() *FloatPoint
} 这些迭代器是通过IteratorCreator接口创建的: type IteratorCreator interface { CreateIterator(opt *IteratorOptions) (Iterator, error)
} IteratorOptions提供了关于字段选择、时间范围和维度的参数，迭代器创建者在规划迭代器时可以使用这些参数。IteratorCreator接口用于许多级别，如Shards、Shard和Engine。这允许在适当的时候执行优化，例如返回预先计算的COUNT()。 迭代器不仅仅是从存储器中读取原始数据。迭代器可以进行组合，以便围绕输入迭代器提供额外的功能。例如，DistinctIterator可以为输入迭代器计算每个时间窗口的不同值。或者，FillIterator可以生成输入迭代器所缺少的额外点。 这种组合也很适合聚合。例如，像这样的语句: SELECT MEAN(temperature) FROM cpu GROUP BY time(10m) 本例中，MEAN(temperature)是一个从底层分片包装迭代器的MeanIterator。但是，如果我们可以添加一个额外的迭代器来确定平均值的导数: SELECT DERIVATIVE(MEAN(temperature), 20m) FROM cpu GROUP BY time(10m) 理解游标 游标通过元组(时间、值)中的分片标识单个序列(测量值、标签集和字段)的数据。游标遍历以日志结构的合并树形式存储的数据，并跨级别处理重复数据删除、删除数据的tombstone和合并缓存(Write Ahead Log)。游标按时间升序或降序对(时间，值)元组进行排序。 理解辅助字段 因为CnosQL允许用户使用FIRST()、LAST()、MIN()和MAX()等选择器函数，所以引擎必须提供一种方法，在选择点的同时返回相关数据。 内置的迭代器 有许多内置迭代器可以让我们构建查询: 排序合并迭代器——该迭代器将一个或多个迭代器合并成一个相同类型的新迭代器。该迭代器保证在开始下一个窗口之前输出窗口内的所有点，但不提供窗口内的排序保证。这允许快速访问聚合查询，而聚合查询不需要更强的排序保证。 限制迭代器——该迭代器限制每个名称/标签组的点数。这是LIMIT & OFFSET语法的实现。 填充迭代器——如果输入迭代器缺少额外的点，这个迭代器会注入额外的点。它可以提供空点、带有前一个值的点或带有特定值的点。 缓冲迭代器——该迭代器提供了将一个点“未读”回缓冲区的能力，以便下次可以再次读取它。这被广泛用于为窗口提供前瞻。 Reduce迭代器——该迭代器为窗口中的每个点调用一个Reduce函数。当窗口完成时，输出该窗口的所有点。这用于简单的聚合函数，如COUNT()。 Reduce Slice迭代器——该迭代器首先收集窗口的所有点，然后将它们一次性全部传递给Reduce函数。迭代器返回结果。这用于聚合函数，如DERIVATIVE()。 Transform迭代器——该迭代器为输入迭代器中的每个点调用Transform函数。它用于执行二进制表达式。 重复数据删除迭代器——此迭代器只输出唯一的点。它是资源密集型的，所以它只用于像元查询语句这样的小查询。 调用迭代器 CnosQL中的函数调用在两个级别上实现。为了提高效率，可以将一些调用封装在多个层上。例如，一个COUNT()可以在分片层执行，然后多个counterator可以与另一个counterator包装，以计算所有分片的计数。这些迭代器可以使用NewCallIterator()创建。有些迭代器更复杂，或者需要在更高的级别上实现。例如，在执行计算之前，DERIVATIVE()需要首先检索窗口的所有点。这个迭代器是由引擎本身创建的，较低级别的迭代器不会被要求创建。

