CnosDB API 是在 CnosDB中查询数据的主要方式。 如果需要执行查询请求，需要将GET请求发送到/query端点，将URL参数db设置为目标数据库，并将参数q设置为查询语句。还可以通过发送相同的参数作为URL参数或作为带有application/x-www-form-urlencoded的正文的一部分来使用POST请求。 示例： curl -G 'http://localhost:8086/query?pretty=true' --data-urlencode "db=weather_data" --data-urlencode "q=SELECT \"speed\" FROM \"wind\" WHERE \"station\"='LianYunGang'" 其结果为： {
"results": [ { "statement_id": 0, "series": [ { "name": "wind", "columns": [ "time", "speed" ], "values": [ [ "2022-04-11T08:03:37.085027Z", 75 ], [ "2022-04-11T08:03:37.085031Z", 75 ] ] } ] } ]
}
